import React from "react";
import Cookies from 'js-cookie';
import './Nav.css';
import * as f from './_functions.js';

class NavLink extends React.Component {
    constructor(props) {
        super(props);

        this.name = props.name;
        this.action = props.action || "front";
        this.switchPage = this.switchPage.bind(this);
    }
    switchPage() {
        f.showPage(this.action);
    }

    render() {
        return (
            <a class="nav-link" onClick={this.switchPage} href="#">{this.name}</a>
        );
    }
}
class NavOption extends NavLink {
    constructor(props) {
        super(props);
    }
    render() {
        return(
            <li class="nav-item">
                {super.render()}
            </li>
        );
    }
}

export default function Nav({ switchPage }) {

    var userid = Cookies.get('userid');
    var username = Cookies.get('username');

    return (
        <nav class="navbar navbar-expand-lg navbar-light bg-light border-bottom">
            <a class="navbar-brand" href="#"><img src="http://localhost:9000/logo" /></a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarText">
                <ul class="navbar-nav w-100">
                    <NavOption name="Home" action="front"/>
                    <NavOption name="Venue" action="venue"/>
                    <li class="nav-item dropdown ml-auto">
                        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" role="button" data-toggle="dropdown"
                            aria-haspopup="true" aria-expanded="false">
                            <div>
                                Guest
                            </div>
                            <span class="fill material-symbols-rounded">
                                account_circle
                            </span>
                        </a>
                        <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">

                            <form method="POST" action="request?">
                                <input type="hidden" name="action" value="register" />
                                <input class="dropdown-item" type="submit" value="Register Account" />
                            </form>
                            <form method="POST" action="request?">
                                <input type="hidden" name="action" value="showbooking" />
                                <input class="dropdown-item" type="submit" value="Manage Booking" />
                            </form>
                            <form method="POST" action="request?">
                                <input type="hidden" name="action" value="showguest" />
                                <input class="dropdown-item" type="submit" value="Manage Guest" />
                            </form>
                            <form method="POST" action="request?">
                                <input type="hidden" name="action" value="logout" />
                                <input class="dropdown-item" type="submit" value="Logout" />
                            </form>
                        </div>
                    </li>
                </ul>
            </div>
        </nav>
    );
}
